    def test_get_feature_tuple(self):
        feature_dict = {
            'initial_tag': 'p', 'is_header': True, 'is_task_scope': False, 'is_req_quals': False, 'is_preff_quals': False,
            'is_legal_notifs': False, 'is_job_title': False, 'is_office_loc': True, 'is_job_duration': False, 'is_supp_pay': False,
            'is_educ_reqs': False, 'is_interv_proc': False, 'is_corp_scope': False, 'is_post_date': False, 'is_other': False,
            'child_str': '<p>Work Remotely:</p>'}
        self.assertEqual(self.hc.get_feature_tuple(feature_dict), ('p', '<p>Work Remotely:</p>', 'H-OL'))

    def test_lda_predict_percent(self):
        navigable_parent = '<i>Identify problems and proactively seek solutions with urgency</i>'
        self.assertAlmostEqual(self.lda.lda_predict_percent(navigable_parent), 0.81780326)

    def test_isheader_lr_predict_percent(self):
        navigable_parent = '<i>Identify problems and proactively seek solutions with urgency</i>'
        self.assertAlmostEqual(self.lru.ISHEADER_PREDICT_PERCENT_FIT(navigable_parent), 0.08396069036423434)

